import React from 'react';
import ReactDOM from 'react-dom/client'; // React 18 createRoot
import { Provider } from 'react-redux'; // Redux Provider
import { store } from './store'; // Redux store import
import App from './App';
import './index.css';

// Create the root element using React 18 API
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Provider store={store}> {/* Wrap your App component with Redux Provider */}
      <App />
    </Provider>
  </React.StrictMode>
);
